import React, { Component } from "react";
import EmployeeDataService from "../services/employee.service";
import '../css/main.css';
import '../../node_modules/font-awesome/css/font-awesome.min.css';
export default class Update extends Component {
  
  render() {
    return (      
        <div>
            <link
                rel="stylesheet"
                href="https://cdn.jsdelivr.net/npm/bootstrap@5.0.2/dist/css/bootstrap.min.css"
                integrity="sha384-EVSTQN3/azprG1Anm3QDgpJLIm9Nao0Yz1ztcQTwFspd3yD65VohhpuuCOmLASjC"
                crossorigin="anonymous"
            />
            {/* Main Content */}
            <div className="search" >
            <i class="fa fa-user" aria-hidden="true"></i><input className="prop" type="text" name="email" id="email" placeholder="Usae Name"></input>
                <input className="prop" type="email" name="email" id="email" placeholder="Email"></input>
                <input className="prop" type="password" name="email" id="email" placeholder="Password"></input>
                <input className="prop" type="text" name="email" id="email" placeholder="Skillsets"></input>
                <input className="prop" type="text" name="email" id="email" placeholder="Domain"></input>
                <input className="prop" type="text" name="email" id="email" placeholder="Tools"></input>
                <input className="prop" type="number" name="email" id="email" placeholder="Experience"></input>
                <input className="small btnsubmit" type="submit" value="Send OTP"></input>
            </div>
            
        </div>
        
    )
    
  }
}
